import React, { useEffect, useState } from "react";
import axios from "axios";


  //API Keys
  const defaultKey = "ede293b25c093960ebbf782841b0b308";


function Home() {

  const [weatherData, setWeatherData] = useState({});
  const [city, setCity] = useState("Dallas");

  useEffect(() => {
    //Make a get request for the weather by city
    axios

    .get(
      `https://api.openweathermap.org/data/2.5/weather?q=${city}&appid=${defaultKey}`
        )

    .then(function (response) {
    // handle success

    setWeatherData(response.data);
    })
  .catch(function (error) {
    // handle error
    console.log(error);
  });

}, []);

console.log("weatherData",weatherData);




  return (
    <div className="Home">
      <h1> Weather in {city} </h1>

    <div className="WeatherInfo">

      <div className="WeatherInfo_Image">
      <img src="" alt=""/>
      </div>

    <div className="WeatherInfo_Data">

      <div className="CurrentTemperature">
        <p> weatherData.main && weatherData.main.temp&#176; </p>
      </div>

      <div className="OtherTemperature">
        <p> High Temp: <strong>{'53'}&#176; </strong>
        </p>
        <p> Low Temp: <strong>{'32'}&#176; </strong>
        </p>

      </div>

      <p> Humididty:{weatherData.main && weatherData.main.humidity}%</p>
      <p> Wind:{'100'}mph </p>

      <div>
        <img src="" alt="" />
      </div>

      <div>

        <h2>48deg</h2>
        <p> High Temp: 53deg </p>
        <p> Low Temp: 32deg </p>
        <p> Humididty: 100% </p>
        <p> Wind: 10mph </p>

      </div>

    </div>

    </div>

    </div>




  );
}

export default Home;
